(function ($) {

    function getPos(index, size) {
        return getCol(index, size) + " " + getRow(index, size);
    }

    function getCol(index, size) {
        return -index % 6 * size + "px";
    }

    function getRow(index, size) {
        return -Math.floor(index / 6) * size + "px";
    }

    var background = "url('data:image/png;base64,')";

    var bgCircle = "url('data:image/png;base64,')";
    var bgLogo = "url('data:image/png;base64,')";

    var methods = {
        init: function (_options) {
            var that = this[0];
            var defaults = {background: false, withoutFinish: true, removeOnComplete: false, size: 256, percents: true};
            that.options = $.extend(defaults, _options);

            //optional
            //that.options =$.extend(true, {}, this._defaults, options);

            that.container = this;
            that.size = that.options.size;
            var coef = that.size / 256;

            var spriteW = 1536 / 256;
            var spriteH = 4352 / 256;

            this.css("position", "relative").css("width", that.size).css("height", that.size);
            var logo = $('<div id="preload_logo" style="width:inherit;height:inherit;position:absolute"></div>');
            that.background = $('<div style="width:inherit;height:inherit;position:absolute"></div>');
            that.circle = $('<div style="width:inherit;height:inherit;position:absolute"></div>');
            that.text = $('<p style="font-family:Arial,sans-serif;font-size:' + 100 * coef + '%;bottom:5%;position:absolute;text-align:center;width:inherit">0%</p>');

            that.background.css("background-image", background).css("background-size",  that.size + "px " + that.size + "px");
            that.circle.css("background-image", bgCircle).css("background-size", spriteW * that.size + "px " + spriteH * that.size + "px");
            logo.css("background-image", bgLogo).css("background-size", spriteW * that.size + "px " + spriteH * that.size + "px");
            if (!that.options.percents) {
                logo.css("top", 13 * coef + "px");
            }
            if (that.options.background) {
                that.container.append(that.background);
            }
            that.container.append(logo);
            that.container.append(that.circle);

            if (that.options.percents) {
                that.container.append(that.text);
            }

            var index = 0;
            var loop = 0;
            var offset = 0;
            animateLogo();

            function setRotation(angle) {
                that.circle.css("transform", 'rotate(' + angle + "deg");
                that.circle.css("-webkit-transform", 'rotate(' + angle + "deg");
                that.circle.css("-ms-transform", 'rotate(' + angle + "deg");
            }

            function setPosition(obj, index) {
                obj.css("background-position", getPos(Math.floor(index), that.size));
            }

            function animateLogo() {
                if (index > 99) {
                    index = 9;
                }
                if (!that.options.percents || that.percentsVaue==0) {
                    if (loop > 199) {
                        loop = 0;
                    }
                    if (loop == 0) {
                        setRotation(0 + offset);
                    } else if (loop < 101) {
                        setRotation(0 + offset);
                        setPosition(that.circle, loop);
                    } else {
                        setPosition(that.circle, 200 - loop);
                        setRotation((loop - 100) / 100 * 360 + offset);
                    }

                    //Additional rotation animation
                    offset++;
                    //-----------------------------


                    loop++;
                }else if(that.options.percents && that.percentsVaue>0){
                    setRotation(0);
                }
                setPosition(logo, index);
                that.requestId = requestAnimationFrame(animateLogo);
                index++;
            }
        },
        update: function (_percents,_message) {
            var that = this[0];
            if(that){
            if (that.options.percents) {
                that.percentsVaue = Math.floor(_percents);
                that.circle.css("background-position", getPos(that.percentsVaue, that.size));
                that.text.html((_message || "")+that.percentsVaue + "%");
                if (that.options.withoutFinish) {
                    if (that.percentsVaue >= 100) {
                        that.container.fadeOut("slow", function () {
                            cancelAnimationFrame(that.requestId);
                            if (that.options.removeOnComplete) {
                                that.container.remove();
                            }
                        });
                    }
                }
                if (that.percentsVaue < 100) {
                    that.container.stop().show();
                }
            } else {
                that.container.stop().show();
            }}
        },
        finish: function (callback) {
            var that = this[0];
            cancelAnimationFrame(that.requestId);
            that.container.fadeOut("slow", function () {
                if (that.options.removeOnComplete) {
                    that.container.remove();
                }
                if (callback != undefined) {
                    callback();
                }
            });
        }
    };
    $.fn.source3Dpreloader = function (methodOrOptions) {
        if (methods[methodOrOptions]) {
            return methods[methodOrOptions].apply(this, Array.prototype.slice.call(arguments, 1));
        } else if (typeof methodOrOptions === 'object' || !methodOrOptions) {
            // Default to "init"
            return methods.init.apply(this, arguments);
        } else {
            $.error('Method ' + methodOrOptions + ' does not exist on jQuery.source3Dpreloader');
        }

    };
})(jQuery);
